import React from 'react'

const Footer = () => {
    return (
        <footer className='row mx-0 '>
             <div className="col-12 py-5 m-0 text-center">                  
                            <h3>
                                2020 iconsquare All rights reserved
                            </h3>                         
             </div>
             <style jsx> {`
                      footer {
                          background:rgba(0,0,0,0.8);
                          color:white;
                          margin-top:10%;                          
                      }  
                      h3 {
                          font-size:2rem;
                      }
                        `}
              </style>
        </footer>
    )
}

export default Footer
